import {React, useParams, useEffect} from "react";

import "./ProjectPost.scss"


const ProjectPost = () => {

    let { postSlug } = useParams();

    useEffect(() => {
        // Fetch post using the postSlug
    }, [postSlug]);

    return (
        <div className="home__wrapper">
            ProjectPost {postSlug}
        </div>
    )
}

export default ProjectPost;
